import Axios from 'axios';
import React, {useState, useEffect} from 'react';
import './App.css';

function App(props) {
  const [data, setData] = useState(null)

  const fetchData = async () => {
    const response = await Axios.get(
      'http://localhost:8080/chat/rooms'
    );
    setData(response.data); // 데이터는 response.data 안에 들어있습니다.
  };

  useEffect(() => {
    fetchData();
  }, []);

  console.log(data)
  return (
    <div className="App">
        <h1>Hey, there!</h1>
        <div>{data.map(room=> <h2>{room.name}</h2>)}</div>
        <input type="text" name="name"/><button>개설</button>

    </div>
  );
}

export default App;
